const Person = (props) => {
  const data = props.data;
  const content = data.categoriesCollection.items.map((item) => (
    <br>{item.displayName}</br>
  ));
  return (
    <div>
      <h1>{data.displayName}</h1>
      <p>{content}</p>
    </div>
  );
};
export default Person;
